import React from 'react';

const Footer = () => {
  return (
    <div>
    <p>&nbsp;</p>
    <p>&nbsp;</p>
    <footer className="fixed-bottom bg-light p-3">
      <p>
        <a href="#">Accueil</a> - 
        <a href="https://www.sonede.com.tn/accueil/taches-courantes/faq">FAQ</a> 
        - <a href="https://www.sonede.com.tn/accueil/taches-courantes/liens-utiles">Liens utiles</a>
         - <a href="https://www.sonede.com.tn/accueil/taches-courantes/nous-contacter">Nous contacter</a>
      </p>
      <p>&copy; 2024 Société Nationale d'Exploitation et de Distribution des Eaux, Tous droits réservés.</p>
    </footer></div>
  );
};

export default Footer;
